full_text:
Honored to join 42 Members of Congress, 21 Ds and 21 Rs, in receiving the Campaign to 
@FixtheDebt's 2020 #FiscalHero Award.  

@BudgetHawks

#FixTheDebt
#NationalDebt

Big congrats to the University of Hawai’i for being awarded a nearly $4.5 million grant from the National Science Foundation @NSF to fund UH’s SX-TransPORT Pacific Islands Research and Education Network (PIREN) project. 
@UHawaiiNews 
